var logoBase64 =
  "data:image/png;base64,";

function getTodayKsaDateTime() {
  const now = new Date();
  const utc = now.getTime() + now.getTimezoneOffset() * 60000;
  const ksaTime = new Date(utc + 3 * 60 * 60 * 1000);
  const day = String(ksaTime.getDate()).padStart(2, "0");
  const month = String(ksaTime.getMonth() + 1).padStart(2, "0");
  const year = ksaTime.getFullYear();
  const hours = String(ksaTime.getHours()).padStart(2, "0");
  const minutes = String(ksaTime.getMinutes()).padStart(2, "0");
  const seconds = String(ksaTime.getSeconds()).padStart(2, "0");
  return `${hours}:${minutes}:${seconds} ${day}/${month}/${year}`;
}

function fixArabicText(str) {
  return str.split(" ").reverse().join(" ");
}

function generateRandom5Digits() {
  return Math.floor(Math.random() * 90000) + 10000;
}

function fixArabicTextMultiline(str) {
  const lines = str.split("\n");
  const fixedLines = lines.map((line) => line.split(" ").reverse().join(" "));
  return fixedLines.join("\n");
}

function collectData() {
  return {
    name: fixArabicText("اسم  العميل: " + $("#js-name").val()),
    phoneNumber: fixArabicText(
      "رقم  هاتف العميل: " + $("#js-phone-number").val()
    ),
    invoiceDate: fixArabicText("تاريخ  الفاتورة: " + getTodayKsaDateTime()),
    invoiceNumber: fixArabicText("رقم  الفاتورة: " + generateRandom5Digits()),
    additionalInfo: fixArabicTextMultiline($("#js-additional-info").val()),
    conditions: fixArabicTextMultiline($("#js-conditions").val()),
  };
}

function printPDF() {
  var data = collectData();

  var docDefinition = {
    content: [
      {
        columns: [
          {
            image: logoBase64,
            width: 100,
            alignment: "left",
            margin: [0, 0, 0, 20],
          },
          {
            stack: [
              {
                text: fixArabicText("تفاصيل  الفاتورة"),
                alignment: "right",
                rtl: true,
                fontSize: 22,
                margin: [0, 0, 0, 15],
              },
              {
                text: data.name,
                alignment: "right",
                rtl: true,
                fontSize: 16,
                margin: [0, 0, 0, 5],
              },
              {
                text: data.phoneNumber,
                alignment: "right",
                rtl: true,
                fontSize: 16,
                margin: [0, 0, 0, 5],
              },
              {
                text: data.invoiceDate,
                alignment: "right",
                rtl: true,
                fontSize: 16,
                margin: [0, 0, 0, 5],
              },
              {
                text: data.invoiceNumber,
                alignment: "right",
                rtl: true,
                fontSize: 16,
              },
            ],
          },
        ],
        columnGap: 20,
        margin: [0, 0, 0, 20],
      },
      {
        text: fixArabicText("معلومات  اضافية:"),
        alignment: "right",
        rtl: true,
        fontSize: 18,
        margin: [0, 0, 0, 10],
      },
      {
        text: data.additionalInfo,
        alignment: "right",
        rtl: true,
        fontSize: 16,
        margin: [0, 0, 0, 5],
      },
      {
        text: fixArabicText("الشروط:"),
        alignment: "right",
        rtl: true,
        fontSize: 18,
        margin: [0, 10, 0, 10],
      },
      {
        text: data.conditions,
        alignment: "right",
        rtl: true,
        fontSize: 16,
      },
    ],
    footer: function (currentPage, pageCount) {
      return {
        columns: [
          {
            image: logoBase64,
            width: 50,
            alignment: "left",
            margin: [265, -50, 0, 0],
          },
        ],
      };
    },
    defaultStyle: {
      font: "almarai",
    },
  };

  pdfMake.createPdf(docDefinition).download();
  pdfMake.createPdf(docDefinition).print();
}
